import {Input,Table} from "@nextui-org/react";
import React from "react";
export default function ModalTipoDeDatos() {
  return (
    <>
      <Input label="Agregar Dato" placeholder="Ej: 9" type="number" css={{
        Width: "100%",
      }}/>
      <Table
      aria-label="Example table with static content"
      css={{
        height: "auto",
        Width: "100%",
      }}
    >
      <Table.Header>
        <Table.Column>Xi</Table.Column>
        <Table.Column>Xi2</Table.Column>
      </Table.Header>
      <Table.Body>
        <Table.Row key="1">
          <Table.Cell>Tony Reichert</Table.Cell>
          <Table.Cell>CEO</Table.Cell>
        </Table.Row>
      </Table.Body>
    </Table>
    </>
  );
}
